const baseURL = "https://67c027cfb9d02a9f22488a0b.mockapi.io";

function testFetch() {
  fetch(`${baseURL}.mockapi.io/material`)
    .then((response) => response.json()) // Преобразуем ответ в JSON
    .then((data) => console.log("Данные с сервера:", data)) // Выводим данные
    .catch((error) => console.error("Ошибка запроса:", error)); // Ловим ошибки
}

export { testFetch };
